function isDesktop() {
    useragent = navigator.userAgent.toLowerCase();
    if (useragent.indexOf('ipad') == -1 &&  useragent.indexOf('iphone') == -1 && useragent.indexOf('kobo') == -1 && useragent.indexOf('symbianos') == -1 && useragent.indexOf('ipod') == -1 && useragent.indexOf('android') == -1 && useragent.indexOf('blackberry') == -1 && useragent.indexOf('samsung') == -1 && useragent.indexOf('nokia') == -1 && useragent.indexOf('windows ce') == -1 && useragent.indexOf('sonyericsson') == -1 && useragent.indexOf('webos') == -1 && useragent.indexOf('wap') == -1 && useragent.indexOf('motor') == -1 && useragent.indexOf('symbian') == -1 && navigator.maxTouchPoints != 5) {
        return true;
    }
    else {
        return false;
    }
}

